import React, { useState, useEffect} from 'react';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import Footer from '../../components/Footer';
import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

const AssignClient = ({ userInfo, handleLogout }) => {
    const location = useLocation();
    const dataItem = location.state?.dataItem;    

    const navigate = useNavigate();

    const backManageReseller = () => {
        navigate('/superadmin/ManageReseller');
    };

    const [posts, setPosts] = useState([]);

    // useEffect(() => {
    //     const fetchAssignedClients = async () => {
    //         try {
    //             const response = await fetch('/superadmin/FetchAssignedClients', {
    //                 method: 'POST',
    //                 headers: {
    //                     'Content-Type': 'application/json',
    //                 },
    //                 body: JSON.stringify({ reseller_id: dataItem?.reseller_id }),
    //             });

    //             if (response.ok) {
    //                 const data = await response.json();
    //                 console.log('Response assign client:',data.data);
    //                 setPosts(data);
    //             } else {
    //                 console.error('Failed to assign charger');
    //             }
    //         } catch (error) {
    //             console.error('An error occurred while adding the charger');
    //             console.error('Error:', error);
    //         }
    //     };
    //     if (dataItem?.reseller_id) {
    //         fetchAssignedClients();
    //     } else {
    //         console.error('Reseller ID not found in dataItem');
    //     }
    // }, [dataItem?.reseller_id]);

    useEffect(() => {
        const fetchAssignedClients = async () => {
            try {
                const response = await fetch('/superadmin/FetchAssignedClients', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify({ reseller_id: dataItem?.reseller_id }),
                });

                if (!response.ok) {
                    throw new Error('Failed to fetch assigned clients');
                }

                const data = await response.json();
                console.log('Response assign client:', data); // Check the structure of 'data' returned

                // Assuming 'data' is an array of posts, update state
                setPosts(data);
            } catch (error) {
                console.error('An error occurred while fetching assigned clients:', error);
            }
        };

        if (dataItem?.reseller_id) {
            fetchAssignedClients();
        } else {
            console.error('Reseller ID not found in dataItem');
        }
    }, [dataItem?.reseller_id]);

    return (
        <div className='container-scroller'>
            {/* Header */}
            <Header userInfo={userInfo} handleLogout={handleLogout} />
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Assign Client's</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={backManageReseller}>Back</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div className="row">
                                            <div className="col-md-12 grid-margin">
                                                <div className="row">
                                                    <div className="col-4 col-xl-8">
                                                        <h4 className="card-title" style={{paddingTop:'10px'}}>List Of Client's</h4>  
                                                    </div>
                                                    <div className="col-8 col-xl-4">
                                                        <div className="input-group">
                                                            <div className="input-group-prepend hover-cursor" id="navbar-search-icon">
                                                                <span className="input-group-text" id="search">
                                                                <i className="icon-search"></i>
                                                                </span>
                                                            </div>
                                                            <input type="text" className="form-control" placeholder="Search now" aria-label="search" aria-describedby="search" autoComplete="off"/>
                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                        <div className="table-responsive">
                                            <table className="table table-striped">
                                                <thead style={{textAlign:'center'}}>
                                                    <tr> 
                                                        <th>Sl.No</th>
                                                        <th>Reseller Name</th>
                                                        <th>Phone Number</th>
                                                        <th>Email ID</th>
                                                        <th>Address</th>
                                                        <th>Status</th>
                                                    </tr>
                                                </thead>
                                                <tbody style={{textAlign:'center'}}>
                                                    <tr>
                                                        <td>1</td>
                                                        <td>kks</td>
                                                        <td>ss</td>
                                                        <td>SparkMinda@gmail.com</td>
                                                        <td>Bangalore</td>
                                                        <td>OK</td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    )
}   

export default AssignClient
